import React from 'react';

interface Props {
  todo: Array<Todo>;
  input: Number;
}

export const TodoListItem:React.FC<Props> = ({ todo, input }) => {
	const checkList = todo.filter(obj => { return obj.month === 1 })
  return  <div>{todo.text}</div>
};
